function calculateTheScore(osmd) {
    var staffEntryContainers = osmd.graphic.verticalGraphicalStaffEntryContainers.length;
    for (var i = 0; i < staffEntryContainers; i++) {
        var numStaffEntries = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries.length;
        for (var n = 0; n < numStaffEntries; n++) {
            if (osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n] != null) {
                var numOfTies = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalTies.length;
                for (var t = 0; t < numOfTies; t++) {
                    var id = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalTies[t].endNote.vfnote[0].attrs.id;
                    allTheTies.push(id);
                }
                var numOfVoices = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries.length;
                for (var v = 0; v < numOfVoices; v++) {
                    if (osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries[v].mVexFlowStaveNote.noteType == 'n') {
                        if (osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries[v].mVexFlowStaveNote.attrs.type == 'StaveNote') {
                            var id = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries[v].mVexFlowStaveNote.attrs.id;
                            var numOfNoteHeads = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries[v].mVexFlowStaveNote.note_heads.length;
                            var xPos = [];
                            var yPos = [];
                            for (var h = 0; h < numOfNoteHeads; h++) {
                                xPos[h] = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries[v].mVexFlowStaveNote.note_heads[h].x;
                                yPos[h] = osmd.graphic.verticalGraphicalStaffEntryContainers[i].staffEntries[n].graphicalVoiceEntries[v].mVexFlowStaveNote.note_heads[h].y;
                            }
                            var theEntry = [id, xPos, n, yPos];
                            allTheNotes.push(theEntry);
                        }
                    }
                }
            }
        }
    }
    allTheNotes = allTheNotes.filter(function(x) {
        return allTheTies.indexOf(x[0]) < 0;
    });
    jQuery('svg .vf-stavenote').each(function() {
        var id = jQuery(this).attr('id');
        for (var i = 0; i < allTheNotes.length; i++) {
            if (id == 'vf-' + allTheNotes[i][0]) {
                if (allTheNotes[i][2] == 0) {
                    for (var c = 0; c < allTheNotes[i][1].length; c++) {
                        scoreLeftRH.push(allTheNotes[i][1][c]);
                        if (jQuery(this).children().children().attr('class') == 'vf-stem') {
                            var notehead = '#' + id + ' .vf-note g:nth-child(' + parseInt(c + 2) + ')';
                        } else {
                            var notehead = '#' + id + ' .vf-note g:nth-child(' + parseInt(c + 1) + ')';
                        }
                        scoreIDsRH.push([notehead, 1, parseFloat(allTheNotes[i][1][c] + 2), allTheNotes[i][3][c]]);
                    }
                } else {
                    for (var c = 0; c < allTheNotes[i][1].length; c++) {
                        scoreLeftLH.push(allTheNotes[i][1][c]);
                        if (jQuery(this).children().children().attr('class') == 'vf-stem') {
                            var notehead = '#' + id + ' .vf-note g:nth-child(' + parseInt(c + 2) + ')';
                        } else {
                            var notehead = '#' + id + ' .vf-note g:nth-child(' + parseInt(c + 1) + ')';
                        }
                        scoreIDsLH.push([notehead, 0, allTheNotes[i][1][c], allTheNotes[i][3][c]]);
                    }
                }
                break;
            }
        }
    });
    scoreLeftRH.sort(function(a, b) {
        return a - b
    });
    scoreLeftLH.sort(function(a, b) {
        return a - b
    });
    if (!isIntro) {
        scoreLeftRH.length = rightHandNotes;
        scoreLeftLH.length = leftHandNotes;
    }
    scoreLeftBOTH = scoreLeftRH.concat(scoreLeftLH);
    scoreLeftBOTH.sort(function(a, b) {
        return a - b
    });
    scoreLeft = scoreLeftBOTH;
    scoreIDsRH.sort(function(a, b) {
        return a[2] - b[2] || b[3] - a[3]
    });
    scoreIDsLH.sort(function(a, b) {
        return a[2] - b[2] || b[3] - a[3]
    });
    if (!isIntro) {
        scoreIDsRH.length = rightHandNotes;
        scoreIDsLH.length = leftHandNotes;
    }
    scoreIDsBOTH = scoreIDsLH.concat(scoreIDsRH);
    scoreIDsBOTH.sort(function(a, b) {
        return a[2] - b[2]
    });
    scoreIDs = scoreIDsBOTH;
    scoreHeight = jQuery('#da-score svg').height();
    if (isIntro || scoreHeight < 400) {
        scoreHeight = 400;
    }
    jQuery('#da-score').css('height', (scoreHeight / 2 + 70) + 'px');
    jQuery('#da-score div').css('top', -(scoreHeight / 3) + 'px');
    jQuery('#scrollLine').css('height', (scoreHeight / 2 - 20) + 'px');
    jQuery('#scrollLine').css('left', windowWidthhalf - 5).hide();
    var dis = scoreLeft[0] - windowWidthhalf;
    jQuery('#da-score svg').css('transform', 'translateX(' + -dis + 'px)');
    jQuery('#da-score svg').css('transition', 'transform 10ms linear');
}
